import React, { Component } from "react";

class TopPosts extends Component {
  constructor() {
    super();
    this.state = {
      posts: [],
    };
  }

  componentDidMount() {

    fetch('https://public-api.wordpress.com/rest/v1.1/sites/153341830/posts/?number=2&order=desc')
    .then(results => {
      return results.json();
    })
    .then(data => {
      let posts = data.results.map((post) => {
        return(
          <div key={post.results}>
            post.content
          </div>
        )
      })
    })
  }
  render() {
    return (
      <div>
        <h1>Hello World!</h1>
      </div>
    );
  }
}

export default TopPosts;
